import { useState } from "react";
import Bike from "./bike";
import Scooty from"./scooty";
import Array from "./list"
function Car() {
  let [color, setstate] = useState("Green");
  return (
    <>
      <h1>My Car {color} FarrariCar</h1>
      <button onClick={() => setstate("Yellow")}>Change color</button>
      <Bike/>
      <Scooty/>
      <Array/>
    </>
  );
}
export default Car;
